svg.script:

var i = 1;
var timer ;
function timerFn(){
	for(var j =1;j<7;j++){
		document.getElementsByClassName("cls-"+j)[0].setAttribute("opacity",0.5);
	}
	timer = setInterval(function(){
		if(i <=6){
			document.getElementsByClassName("cls-"+i)[0].setAttribute("opacity",1);
			i++;
		}else{
			i=1;
			window.clearInterval(timer)
		}
	},500)
}
timerFn();
setInterval(function(){
	timerFn();
},8000)
